import React from "react";

function AdCarousel() {
  return (
    <div className="overflow-hidden relative bg-gray-200">
      <div className="flex animate-marquee">
        <img src="https://via.placeholder.com/300x150?text=Ad+1" alt="Ad1" className="mx-2" />
        <img src="https://via.placeholder.com/300x150?text=Ad+2" alt="Ad2" className="mx-2" />
        <img src="https://via.placeholder.com/300x150?text=Ad+3" alt="Ad3" className="mx-2" />
      </div>
    </div>
  );
}

export default AdCarousel;
